      'grant_type' :'password',
      "username": "admin",
      "password": "Vbd@329331LTK"
    })
      .then(res => {
        console.log(res.data);
      })
      .catch((error) => {
        console.log(error)
      });
  }, [])

  return <>
    <div>
      <Map />
    </div>
  </>
  {/* <UserCPN />
      <NoteCPN />
      <TodoList/> */}
}
